var Pgsql = {};
Pgsql.load = function() {

    ace.define('ace/snippets/pgsql', ['require', 'exports', 'module' ], function(require, exports, module) {
        
        
        exports.snippetText = "";
        exports.scope = "pgsql";
        
        });
        
};

//-------------------------------------------------------------------------------
// Exports
//-------------------------------------------------------------------------------

bugpack.export('acesnippets.Pgsql', Pgsql);
